(window.webpackJsonp=window.webpackJsonp||[]).push([[55],{60:function(e,t,a){"use strict";a.r(t);var n=a(0),l=function(e){var t,a,n,l,s,o,r,i,p,u,g,d,c,y,x,w,m,v,b,k,h,D,A,f,T,H,j,C,S,R,P,q,E,I,z,U,G,J,W,M,N,L,V,O,Q,B,Y,_,F,X,$,K,Z,ee,te,ae,ne,le,se,oe,re,ie,pe,ue,ge,de,ce,ye,xe,we,me,ve,be,ke,he,De,Ae,fe,Te,He,je,Ce,Se,Re,Pe,qe,Ee,Ie,ze,Ue,Ge,Je,We,Me,Ne,Le,Ve,Oe,Qe,Be,Ye,_e,Fe,Xe,$e,Ke,Ze,et=(t=void 0,n="markdown",l=!0,s="Life",o=null,r="Coding",i="Thinking",p="exp",u="总结",g="相关链接",d="消费",c="博客成绩",y="depth",x="延伸阅读",w="tech",m="summary",v="music",b="Preface",k="文章没有深度",D={},A={},f={},T={},H="文章写不长",j={},C="thinking",S={},R={},P={},q="Reviews",E="浏览网页、社交网络",I="处理照片",z="没什么人看",U="做不到一直更新",G="延伸链接",J={},W={},M={},N="接触健身的经历",L="关于请教练",V="关于饮食",O="关于蛋白粉",Q="关于训练",B="怎么选健身房",Y="关于坚持",_={},F={},X={},$={},K={},Z={},ee={},te={},ae={},ne={},le={},se="最简单的前端查询",oe="操作成功后更新列表数据",re={},ie="常被问到的问题",pe={},ue={},ge="preface",de="用户访问的时段",ce={},ye={},xe={},we={},me={},ve={},be={},ke={},he="lifeshacker",De={},Ae={},fe={},Te={},He={},je={},Ce="javascript",Se="类型检查是一种负担吗？",Re={},Pe="lifestyle",qe="介绍一下你自己和所做的工作",Ee="你都在使用哪些硬件？",Ie="你最理想的工作环境是什么？",ze="你平时获得工作灵感的方式有哪些？",Ue="推荐一件生活中的利器给大家",Ge={},Je={},We="oh-my-zsh",Me="homebrew",Ne="proxychains-ng",Le={},Ve={},Oe={},Qe={},Be={},Ye={},_e="五笔快还是拼音快？",Fe="那我现在学不学五笔好？",Xe="最后推荐个输入法？",$e={},Ke={},Ze={},(h={}).type=a="post",h.internal=t,h.contentType=n,h.slug="newness",h.content=t,h.createdAt=new Date(1568637235e3),h.updatedAt=new Date(1573555321975),h.title="爱情是愿意为你放弃寻新鲜",h.layout=a,h.date="2019-09-16 20:33:55",h.tags=o,h.markdownHeadings=[],h.excerpt="<p>昨天在回杭的飞机上看完《Newness》, 一部探讨开放性关系的电影。男女主角都喜欢新鲜感，最后因为约炮堕入爱河，但很快开始感到关系平淡和厌倦，于是尝试开放性关系. 各自一番经历后最终决定放弃自由，认真经营这段感情。</p>\n",h.permalink="/blog/newness",h.assets={},h.attributes=h,D.type="page",D.internal=t,D.contentType=n,D.slug="index",D.content=t,D.createdAt=new Date(1573548091973),D.updatedAt=new Date(1573548091973),D.injectAllPosts=l,D.layout="index",D.markdownHeadings=[],D.permalink="/",D.assets={},D.attributes=D,D.posts=[$,ae,ve,K,ee,fe,h,A,f,T,j,S,R,P,J,W,M,_,F,X,Z,te,ne,le,re,pe,ue,ce,ye,xe,we,me,be,ke,De,Ae,Te,He,je,Re,Ge,Je,Le,Ve,Oe,Qe,Be,Ye,$e,Ke,Ze],D.pagination={hasPrev:!1,hasNext:!1,total:1,current:1,prevLink:"/page/2",nextLink:t},A.type=a,A.internal=t,A.contentType=n,A.slug="my-zsxq",A.content=t,A.createdAt=new Date(1563764935e3),A.updatedAt=new Date(1573548091957),A.title="我开通了知识星球",A.layout=a,A.date="2019-07-22 11:08:55",A.markdownHeadings=[],A.excerpt="<p>我不太喜欢程序员圈子的社交，写博客多年，收到了不少对我博客和文章的打赏，和一些有心的网友发长邮件对我提问，但一直没有与我的博客读者们建立起一种有效关系。我想，何不让支持我博客的读者在打赏的同时，作为回报，可以在知识星球向我提问，或获得我认为有价值的分享呢。</p>\n",A.permalink="/blog/my-zsxq",A.assets={},A.attributes=A,f.type=a,f.internal=t,f.contentType=n,f.slug="declarative-programming-is-the-future",f.content=t,f.createdAt=new Date(156345189e4),f.updatedAt=new Date(1573548091942),f.title="未来属于声明式编程",f.date="2019-07-18 20:11:30",f.layout=a,f.categories=[r],f.tags=o,f.pin=l,f.markdownHeadings=[{text:"Conclusion",slug:"conclusion",level:2}],f.excerpt='<p><a href="https://zh.wikipedia.org/zh-cn/%E5%AE%A3%E5%91%8A%E5%BC%8F%E7%B7%A8%E7%A8%8B?oldformat=true">声明式编程</a> （Declarative Programming）是一种编程范式。现实世界中，我们大部分编码都是命令式的。</p>\n',f.permalink="/blog/declarative-programming-is-the-future",f.assets={},f.attributes=f,T.type=a,T.internal=t,T.contentType=n,T.slug="to-hongkong-people",T.content=t,T.createdAt=new Date(1560769315e3),T.updatedAt=new Date(1573548091966),T.title="井底之蛙的一片天空",T.layout=a,T.date="2019-06-17 19:01:55",T.categories=[i],T.pin=l,T.markdownHeadings=[],T.excerpt="<p>有次和朋友提到移民的想法，他说，为什么不考虑日本呢？我的回答是，我对日本没有特别的情感。朋友说他正相反。然后他问道：难道你的童年没有看日本动画吗？</p>\n",T.permalink="/blog/to-hongkong-people",T.assets={},T.attributes=T,j.type=a,j.internal=t,j.contentType=n,j.slug="want-it-cuz-it-is-right",j.content=t,j.createdAt=new Date(1560423991e3),j.updatedAt=new Date(1573548091969),j.title="我想得到它，因为它是好的",j.date="2019-06-13 19:06:31",j.layout=a,j.pin=l,j.categories=[i],j.tags=[C],j.markdownHeadings=[],j.excerpt="<p>王小波在《跳出手掌心》里有这么一段话，初读时使我似醍醐灌顶：</p>\n",j.permalink="/blog/want-it-cuz-it-is-right",j.assets={},j.attributes=j,S.type=a,S.internal=t,S.contentType=n,S.slug="a-poem-for-you",S.content=t,S.createdAt=new Date(1560344605e3),S.updatedAt=new Date(1573555188829),S.title="为你写的一首诗",S.date="2019-06-12 21:03:25",S.layout=a,S.tags=o,S.markdownHeadings=[],S.excerpt="<p>我喜欢你</p>\n",S.permalink="/blog/a-poem-for-you",S.assets={},S.attributes=S,R.type=a,R.internal=t,R.contentType=n,R.slug="nearly-blog-change",R.content=t,R.createdAt=new Date(1560266189e3),R.updatedAt=new Date(1573548091958),R.title="博客近期的变化",R.layout=a,R.date="2019-06-11 23:16:29",R.tags=o,R.markdownHeadings=[{text:"图片 CDN 迁移到了阿里云",slug:"图片-cdn-迁移到了阿里云",level:3},{text:"全站 Cloudflare",slug:"全站-cloudflare",level:3}],R.excerpt="<p>从上个月开始，博客的图片全部无法显示，原因是新浪微博开始防盗链了。</p>\n",R.permalink="/blog/nearly-blog-change",R.assets={},R.attributes=R,P.type=a,P.internal=t,P.contentType=n,P.slug="ipad-pro-11-review",P.content=t,P.createdAt=new Date(1554528493e3),P.updatedAt=new Date(1573555321942),P.title="11 寸 iPad Pro 体验",P.layout=a,P.date="2019-04-06 13:28:13",P.categories=[q],P.cover="https://gbstatic.djyde.com/FullSizeRender.jpg?x-oss-process=style/cover",P.markdownHeadings=[{text:"用 Kindle App 阅读",slug:"用-kindle-app-阅读",level:2},{text:E,slug:E,level:2},{text:I,slug:I,level:2},{text:"写字",slug:"写字",level:2},{text:u,slug:u,level:1},{text:g,slug:g,level:3}],P.excerpt='<p><img src="https://gbstatic.djyde.com/DSC02308.JPG?x-oss-process=image/resize,w_2560/quality,q_80" alt=""></p>\n',P.permalink="/blog/ipad-pro-11-review",P.assets={},P.attributes=P,J.type=a,J.internal=t,J.contentType=n,J.slug="everything-is-about-trade-off",J.content=t,J.createdAt=new Date(1554287585e3),J.updatedAt=new Date(1573548091944),J.title="人生是不断取舍的过程",J.date="2019-04-03 18:33:05",J.layout=a,J.categories=[i],J.tags=o,J.pin=l,J.markdownHeadings=[],J.excerpt="<p>如果问工作以来我悟出的最重要的观念是什么，那就是，人生是一个不断取舍的过程。</p>\n",J.permalink="/blog/everything-is-about-trade-off",J.assets={},J.attributes=J,W.type=a,W.internal=t,W.contentType=n,W.slug="modern-react",W.content=t,W.createdAt=new Date(1552011647e3),W.updatedAt=new Date(1573548091953),W.title="现代的 React",W.layout=a,W.categories=[r],W.date="2019-03-08 10:20:47",W.tags=o,W.markdownHeadings=[],W.excerpt="<p>我一直很想写一本关于 React 的小书，因为我看到很多刚入门前端或刚开始使用 React 的开发者，对 React 有一些误解。也许是因为 JSX, 让很多人误以为 React 是一种黑魔法 —— 竟然能在 JS 文件里写 HTML! 还有很多围绕 React 的问题，像「状态管理」，就让很多人焦头烂额了。也正是因为 JSX, 让很多人依然用模板的思维去写 React.</p>\n",W.permalink="/blog/modern-react",W.assets={},W.attributes=W,M.type=a,M.internal=t,M.contentType=n,M.slug="one-year-of-bulking",M.content=t,M.createdAt=new Date(1547449537e3),M.updatedAt=new Date(1573548091960),M.title="健身一年",M.layout=a,M.date="2019-01-14 15:05:37",M.categories=[s],M.tags=o,M.markdownHeadings=[{text:N,slug:N,level:2},{text:L,slug:L,level:2},{text:V,slug:V,level:2},{text:O,slug:O,level:3},{text:Q,slug:Q,level:2},{text:B,slug:B,level:2},{text:Y,slug:Y,level:2},{text:g,slug:g,level:2}],M.excerpt="<p>本文不提供训练计划\n本文不提供饮食计划</p>\n",M.permalink="/blog/one-year-of-bulking",M.assets={},M.attributes=M,_.type=a,_.internal=t,_.contentType=n,_.slug="show-my-albums",_.content=t,_.createdAt=new Date(1547381591e3),_.updatedAt=new Date(1573548091963),_.title="我买过的实体唱片",_.layout=a,_.date="2019-01-13 20:13:11",_.categories=[s],_.tags=o,_.markdownHeadings=[],_.excerpt="<p>今天做大扫除，顺便整理了一下我的 CD, 突然想到可以和大家介绍一下我的这些 CD.</p>\n",_.permalink="/blog/show-my-albums",_.assets={},_.attributes=_,F.type=a,F.internal=t,F.contentType=n,F.slug="donation",F.content=t,F.createdAt=new Date(1547086539e3),F.updatedAt=new Date(1573548091944),F.title="本博客的赞助渠道",F.date="2019-01-10 10:15:39",F.layout=a,F.hide=l,F.markdownHeadings=[],F.excerpt="<p>你可以通过以下几种赞助渠道表达对我的支持，支持我不断地更新下去：</p>\n",F.permalink="/blog/donation",F.assets={},F.attributes=F,X.type=a,X.internal=t,X.contentType=n,X.slug="2018-summary",X.content=t,X.createdAt=new Date(1546830768e3),X.updatedAt=new Date(1573555321942),X.title="2018 年终总结",X.date="2019-01-07 11:12:48",X.layout=a,X.categories=[s],X.tags=o,X.markdownHeadings=[{text:"工作",slug:"工作",level:2},{text:d,slug:d,level:2},{text:"输出",slug:"输出",level:2},{text:"生活",slug:"生活",level:2},{text:"健身",slug:"健身",level:3},{text:"德州扑克",slug:"德州扑克",level:3},{text:c,slug:c,level:2},{text:"关于 2019",slug:"关于-2019",level:2}],X.excerpt="<p>大人热爱数字。如果你跟他们说你认识了新朋友，他们从来不会问你重要的事情。他们从来不会说：“他的声音听起来怎么样？他最喜欢什么游戏？他收集蝴蝶吗？”</p>\n",X.permalink="/blog/2018-summary",X.assets={},X.attributes=X,$.type=a,$.internal=t,$.contentType=n,$.slug="what-is-tailwindcss-and-how-did-i-apply-it-on-my-blog",$.content=t,$.createdAt=new Date(157356504e4),$.updatedAt=new Date(1573565205214),$.title="博客改版及 Tailwind CSS 实践",$.layout=a,$.date="2019-11-12 21:24",$.pin=l,$.markdownHeadings=[],$.excerpt="<p>如您所见，本博客在前不久进行了微小的改版，改版的目的是做一个可以承载更多元内容的版式，如无意外，在未来的不久，我会增加「摄影」和「乐评」两个新的版块。</p>\n",$.permalink="/blog/what-is-tailwindcss-and-how-did-i-apply-it-on-my-blog",$.assets={},$.attributes=$,K.type=a,K.internal=t,K.contentType=n,K.slug="letter-from-few-years-ago",K.content=t,K.createdAt=new Date(157293702e4),K.updatedAt=new Date(1574391154781),K.title="来自 2014 年给未来的我的一封信",K.layout=a,K.date="2019-11-05 14:57",K.markdownHeadings=[],K.excerpt='<p><img src="https://gbstatic.djyde.com/blog/lett.jpeg" alt="这封信的照片"></p>\n',K.permalink="/blog/letter-from-few-years-ago",K.assets={},K.attributes=K,Z.type=a,Z.internal=t,Z.contentType=n,Z.slug="2018-cantonpop-list",Z.content=t,Z.createdAt=new Date(1545191197e3),Z.updatedAt=new Date(1573548091938),Z.title="2018 香港流行音乐推介",Z.date="2018-12-19 11:46:37",Z.layout=a,Z.tags=[v],Z.markdownHeadings=[],Z.excerpt="<p>「香港乐坛已死」已经不是什么新鲜的论调，这句话也经常被用于伪装自己对当代流行音乐颇有研究。作为一个港乐爱好者，我对此一直持相反的意见。港乐没死，但它的确从大众变成小众了。</p>\n",Z.permalink="/blog/2018-cantonpop-list",Z.assets={},Z.attributes=Z,ee.type=a,ee.internal=t,ee.contentType=n,ee.slug="what-i-have-done-at-UC",ee.content=t,ee.createdAt=new Date(1569591486e3),ee.updatedAt=new Date(1573548091970),ee.title="我在 UC 做的前端工程化探索",ee.date="2019-09-27 21:38:06",ee.layout=a,ee.categories=[r],ee.pin=l,ee.tags=[w],ee.markdownHeadings=[{text:"框架设计",slug:"框架设计",level:2}],ee.excerpt="<p>我在 2016 年初加入 UC 的国际业务部，负责为 UC News 搭建运营后台。随着前端团队人数越来越多，我开始推动团队的前端技术栈统一以及前端工程化，开发了一个叫 Cans 用于快速搭建中后台前端应用的框架。直到了 2019 年我离开 UC, Cans 仍然服务于 UC 的国际业务。</p>\n",ee.permalink="/blog/what-i-have-done-at-UC",ee.assets={},ee.attributes=ee,te.type=a,te.internal=t,te.contentType=n,te.slug="things-i-learnt-at-school",te.content=t,te.createdAt=new Date(1538656937e3),te.updatedAt=new Date(1573548091966),te.title="我在学校学到的东西",te.layout=a,te.date="2018-10-04 20:42:17",te.categories=[i],te.pin=l,te.tags=[y,p],te.markdownHeadings=[],te.excerpt="<p>今年身边的朋友陆陆续续毕业出来工作了，偶尔有机会的时候会聚在一起聊聊，然后谈到各自的就业情况。我发现有很多朋友还不知道自己想从事的职业是什么，因此也不知道自己未来会怎么样，先做着现在能做的。</p>\n",te.permalink="/blog/things-i-learnt-at-school",te.assets={},te.attributes=te,ae.type=a,ae.internal=t,ae.contentType=n,ae.slug="sony-discman-d9",ae.content=t,ae.createdAt=new Date(15732576e5),ae.updatedAt=new Date(1573548091963),ae.title="1989 年的 CD 机 - SONY Discman D-9",ae.date="2019-11-09",ae.layout=a,ae.cover="https://gbstatic.djyde.com/blog/Snapseed%2017.JPG?x-oss-process=style/80",ae.markdownHeadings=[],ae.excerpt="<p>我应该是为数不多仍然在听 CD 的年轻一代。对于我来说，购买 CD 首先是支持自己喜欢的音乐和艺人最直接的方式，即使售卖 CD 已经不再是做音乐主要的收入来源。其次，在数字时代，发行过的歌，可能忽然又触及红线，再也没法听到（除了盗版），CD 可以将我喜爱的音乐作品永远留存。</p>\n",ae.permalink="/blog/sony-discman-d9",ae.assets={},ae.attributes=ae,ne.type=a,ne.internal=t,ne.contentType=n,ne.slug="trick-for-reading-source-code",ne.content=t,ne.createdAt=new Date(1536905647e3),ne.updatedAt=new Date(1573555321942),ne.title="一个阅读源代码的技巧",ne.layout=a,ne.date="2018-09-14 14:14:07",ne.categories=[r],ne.tags=o,ne.markdownHeadings=[],ne.excerpt="<p>昨天和朋友聊到阅读开源代码，我分享了自己一个读代码的技巧，就是从第一个 commit 开始读。</p>\n",ne.permalink="/blog/trick-for-reading-source-code",ne.assets={},ne.attributes=ne,le.type=a,le.internal=t,le.contentType=n,le.slug="effective-graphql-and-antd",le.content=t,le.createdAt=new Date(153672204e4),le.updatedAt=new Date(1574651260832),le.title="高效的 GraphQL + Ant.Design",le.layout=a,le.date="2018-09-12 11:14",le.pin=l,le.markdownHeadings=[{text:"什么是 GraphQL",slug:"什么是-graphql",level:2},{text:"什么是 Apollo",slug:"什么是-apollo",level:2},{text:"搭建一个 GraphQL 服务器",slug:"搭建一个-graphql-服务器",level:3},{text:se,slug:se,level:3},{text:"进阶实例",slug:"进阶实例",level:2},{text:"查询参数",slug:"查询参数",level:3},{text:"操作数据 (Mutation)",slug:"操作数据-mutation",level:3},{text:oe,slug:oe,level:3},{text:"更新查询的 Cache",slug:"更新查询的-cache",level:4},{text:"重新执行查询",slug:"重新执行查询",level:4},{text:"分页异步加载",slug:"分页异步加载",level:3},{text:"What's next",slug:"whats-next",level:2}],le.excerpt='<p>在过去的几年，不论是面向内部的系统，还是面向外部的产品，我们都大量地使用了 <a href="http://ant.design">Ant.Design</a> —— 一个基于 React 的 UI 组件库。</p>\n',le.permalink="/blog/effective-graphql-and-antd",le.assets={},le.attributes=le,re.type=a,re.internal=t,re.contentType=n,re.slug="announcing-serlina",re.content=t,re.createdAt=new Date(1534153449e3),re.updatedAt=new Date(1573548091941),re.title="Serlina: 渐进式的 React 服务器渲染框架",re.date="2018-08-13 17:44:09",re.categories=[r],re.layout=a,re.markdownHeadings=[{text:"起因",slug:"起因",level:2},{text:"最简单的例子",slug:"最简单的例子",level:2},{text:"在 Egg 中使用",slug:"在-egg-中使用",level:2},{text:ie,slug:ie,level:2},{text:"和 Next.js 有什么区别",slug:"和-next-js-有什么区别",level:3}],re.excerpt="<p>副标题: 《可能是最适合 Egg 的 React Serverside-rendering 方案》</p>\n",re.permalink="/blog/announcing-serlina",re.assets={},re.attributes=re,pe.type=a,pe.internal=t,pe.contentType=n,pe.slug="think-deeper",pe.content=t,pe.createdAt=new Date(1531712855e3),pe.updatedAt=new Date(1573548091966),pe.title="多研究些问题，少谈些框架",pe.layout=a,pe.categories=[i],pe.date="2018-07-16 11:47:35",pe.tags=["tweet",C],pe.markdownHeadings=[],pe.excerpt="<p>当我问应聘者「你有什么问题想问」的时候，大多数应聘者会问我前端应该怎么学。我每次都会很真诚地按照面试过程对他们的了解尝试给他们一些建议。从多次的交流当中，我倒是慢慢地了解到了前端领域里很多普遍的问题。</p>\n",pe.permalink="/blog/think-deeper",pe.assets={},pe.attributes=pe,ue.type=a,ue.internal=t,ue.contentType=n,ue.slug="2017-summary",ue.content=t,ue.createdAt=new Date(1514976464e3),ue.updatedAt=new Date(1573555321942),ue.title="2017 年终总结",ue.layout=a,ue.date="2018-01-03 18:47:44",ue.categories=[s],ue.tags=o,ue.markdownHeadings=[{text:b,slug:ge,level:2},{text:c,slug:c,level:2},{text:"PV/UV",slug:"pvuv",level:3},{text:"操作系统",slug:"操作系统",level:3},{text:"来源",slug:"来源",level:3},{text:de,slug:de,level:3},{text:"设备",slug:"设备",level:3},{text:d,slug:d,level:2},{text:"电子产品",slug:"电子产品",level:3},{text:"iPhone 8",slug:"iphone-8",level:4},{text:"SONY 黑卡 1",slug:"sony-黑卡-1",level:4},{text:"DS216j/DS218+",slug:"ds216jds218",level:4},{text:"Yamaha P115 / Yamaha NP12",slug:"yamaha-p115--yamaha-np12",level:4},{text:"Nintendo Switch",slug:"nintendo-switch",level:4},{text:"DJI Spark",slug:"dji-spark",level:4},{text:"新年计划",slug:"新年计划",level:2}],ue.excerpt="<p>我的 2017 过得很平淡，可能是因为出来工作已经是第二年了。</p>\n",ue.permalink="/blog/2017-summary",ue.assets={},ue.attributes=ue,ce.type=a,ce.internal=t,ce.contentType=n,ce.slug="my-underground-publication",ce.content=t,ce.createdAt=new Date(1503666257e3),ce.updatedAt=new Date(1573555321965),ce.title="我的地下刊物",ce.layout=a,ce.categories=[s],ce.date="2017-08-25 21:04:17",ce.tags=o,ce.markdownHeadings=[],ce.excerpt='<p>一个月前一位初中朋友 Bunny 发了一篇 <a href="https://mp.weixin.qq.com/s/tfzlzCEQJuIQDS-Djbg8CA">《年少的文字》</a>，讲起了初中的我们搞地下刊物的事，让我想起了那段时间这本刊物的一些点滴。</p>\n',ce.permalink="/blog/my-underground-publication",ce.assets={},ce.attributes=ce,ye.type=a,ye.internal=t,ye.contentType=n,ye.slug="cat-capriccio",ye.content=t,ye.createdAt=new Date(1503240715e3),ye.updatedAt=new Date(1574391154781),ye.title="养猫随想",ye.date="2017-08-20 22:51:55",ye.layout=a,ye.categories=[s],ye.cover="https://gbstatic.djyde.com/assets/006tNc79gy1fiql3pxyssj31kw11x0w8.jpg?x-oss-process=style/cover",ye.markdownHeadings=[],ye.excerpt="<p>我是个很怕负责任并且不感性的人，养一只猫对我来说，是一种很大的责任。</p>\n",ye.permalink="/blog/cat-capriccio",ye.assets={},ye.attributes=ye,xe.type=a,xe.internal=t,xe.contentType=n,xe.slug="synology-ds216j-exp",xe.content=t,xe.createdAt=new Date(1499742707e3),xe.updatedAt=new Date(1573548091965),xe.title="群晖 DS216j 半年体验报告",xe.layout=a,xe.date="2017-07-11 11:11:47",xe.categories=[q],xe.cover="http://cdn.sspai.com/2017/07/11/db02e0732a1a85cec28c109c44dafcf6.jpg",xe.tags=["evaluation","digitle"],xe.markdownHeadings=[{text:"DSM",slug:"dsm",level:3},{text:"多媒体中心",slug:"多媒体中心",level:3},{text:"Aria2",slug:"aria2",level:4},{text:"迅雷远程下载",slug:"迅雷远程下载",level:4},{text:"TimeMachine",slug:"timemachine",level:4},{text:u,slug:u,level:3}],xe.excerpt="<p>今年（2017年）2月份入手了 Synology DS216j，不知不觉已经过去了半年。</p>\n",xe.permalink="/blog/synology-ds216j-exp",xe.assets={},xe.attributes=xe,we.type=a,we.internal=t,we.contentType=n,we.slug="my-coding-road",we.content=t,we.createdAt=new Date(14945767e5),we.updatedAt=new Date(1574391154794),we.title="我的编程经历",we.date="2017-05-12 16:11:40",we.layout=a,we.categories=[r],we.tags=[p],we.pin=l,we.markdownHeadings=[],we.excerpt="<p>我接触编程的时间比较早，是 13 岁。我为什么记得是 13 岁，因为我六年级那年正好 13 岁，我是六年级开始编程的。</p>\n",we.permalink="/blog/my-coding-road",we.assets={},we.attributes=we,me.type=a,me.internal=t,me.contentType=n,me.slug="gitlab-ci-runner",me.content=t,me.createdAt=new Date(1492690662e3),me.updatedAt=new Date(1574391154781),me.title="搭建自己的 Gitlab CI Runner",me.layout=a,me.categories=[r],me.date="2017-04-20 20:17:42",me.tags=o,me.markdownHeadings=[{text:b,slug:ge,level:2},{text:"CI (Continuous Integration)",slug:"ci-continuous-integration",level:3},{text:"CI Runner",slug:"ci-runner",level:3},{text:"Gitlab Runner 环境",slug:"gitlab-runner-环境",level:2},{text:"安装 Docker",slug:"安装-docker",level:3},{text:"拉取 gitlab-runner 镜像",slug:"拉取-gitlab-runner-镜像",level:3},{text:"添加 gitlab-runner container",slug:"添加-gitlab-runner-container",level:3},{text:"配置用于 runner 的 docker image",slug:"配置用于-runner-的-docker-image",level:3},{text:"构建 Docker Image",slug:"构建-docker-image",level:3},{text:"注册 Runner",slug:"注册-runner",level:3},{text:"FAQ",slug:"faq",level:2},{text:"CI 运行时出现 ERROR: Job failed: API error (404): repository xxx not found: does not exist or no pull access",slug:"ci-运行时出现-error-job-failed-api-error-404-repository-xxx-not-found-does-not-exist-or-no-pull-access",level:3},{text:x,slug:x,level:2}],me.excerpt="<p>假定你已经有一台可用的，可联网的机器</p>\n",me.permalink="/blog/gitlab-ci-runner",me.assets={},me.attributes=me,ve.type=a,ve.internal=t,ve.contentType=n,ve.slug="reason-why-your-blog-is-not-alive",ve.content=t,ve.createdAt=new Date(157294518e4),ve.updatedAt=new Date(1573548091962),ve.title="为什么无法坚持写博客",ve.date="2019-11-05 17:13",ve.layout=a,ve.pin=l,ve.markdownHeadings=[{text:k,slug:k,level:4},{text:H,slug:H,level:4},{text:z,slug:z,level:4},{text:U,slug:U,level:4},{text:G,slug:G,level:3}],ve.excerpt="<p>如果你被本文的标题吸引，那么你应该已经试过很多次雄心勃勃地开始选择你喜欢的静态网站生成器 (Static Site Generator), 然后精心挑选或者自行手写一个你钟意的主题，写下一篇题为 “Hello World” 的博客，宣称从今天起重新开始写博客。几个月后就再也不更新了。</p>\n",ve.permalink="/blog/reason-why-your-blog-is-not-alive",ve.assets={},ve.attributes=ve,be.type=a,be.internal=t,be.contentType=n,be.slug="do-have-faith-with-yourself",be.content=t,be.createdAt=new Date(1489497045e3),be.updatedAt=new Date(1573548091943),be.title="做技术要自信",be.layout=a,be.categories=[i],be.date="2017-03-14 21:10:45",be.pin=l,be.markdownHeadings=[],be.excerpt="<p>我很久以前就把博客的评论直接去掉了，原因是大多数评论毫无营养，如果我发技术类的文章，评论都是「围观」，「膜拜」之类的内容。偶尔有人会通过微博私信问我技术，开头都是很客气，称呼我「大神」，然后声称自己很「菜」。总的来说，就是把自己的地位拉得很底，误以为这是一种谦虚。</p>\n",be.permalink="/blog/do-have-faith-with-yourself",be.assets={},be.attributes=be,ke.type=a,ke.internal=t,ke.contentType=n,ke.slug="piano-on-computer-keyboard",ke.content=t,ke.createdAt=new Date(1487487218e3),ke.updatedAt=new Date(1573548091960),ke.title="电脑键盘上的流行钢琴伴奏",ke.layout=a,ke.date="2017-02-19 14:53:38",ke.tags=[he,v],ke.markdownHeadings=[{text:"How it likes",slug:"how-it-likes",level:2},{text:"Why it works",slug:"why-it-works",level:2},{text:"How it works",slug:"how-it-works",level:2},{text:"局限性",slug:"局限性",level:2},{text:"Play it now",slug:"play-it-now",level:2}],ke.excerpt="<p>我在好几个月前入了一个 MIDI 键盘，自学了一段时间的流行钢琴伴奏(弹唱)和相关的乐理，但是由于工作和其它事情的原因，没有太多的时间练习指法，以至于仍然很难熟练地弹唱一首流行歌曲。</p>\n",ke.permalink="/blog/piano-on-computer-keyboard",ke.assets={},ke.attributes=ke,De.type=a,De.internal=t,De.contentType=n,De.slug="react-and-the-way-building-web-ui",De.content=t,De.createdAt=new Date(1483208376e3),De.updatedAt=new Date(1573548091961),De.title="从 React 谈 Web UI 开发",De.date="2017-01-01 02:19:36",De.layout=a,De.categories=[r],De.tags=["frontend","react"],De.pin=l,De.markdownHeadings=[],De.excerpt="<p>此前我在 Twitter 上这样表达过对 React 的理解，但是 Twitter 篇幅有限，所以在这篇文章里，我要做更详尽的阐述。</p>\n",De.permalink="/blog/react-and-the-way-building-web-ui",De.assets={},De.attributes=De,Ae.type=a,Ae.internal=t,Ae.contentType=n,Ae.slug="2016-summary",Ae.content=t,Ae.createdAt=new Date(14828832e5),Ae.updatedAt=new Date(1573548091935),Ae.title="2016 年终总结",Ae.date="2016-12-28",Ae.tags=m,Ae.layout=a,Ae.categories=[s],Ae.markdownHeadings=[{text:"博客篇",slug:"博客篇",level:2},{text:"访问量",slug:"访问量",level:4},{text:"访问设备",slug:"访问设备",level:4},{text:"来源浏览器",slug:"来源浏览器",level:4},{text:"文章排行",slug:"文章排行",level:4},{text:"技术篇",slug:"技术篇",level:2},{text:"工作篇",slug:"工作篇",level:2},{text:"读书篇",slug:"读书篇",level:2},{text:"游戏篇",slug:"游戏篇",level:2},{text:"自我总结",slug:"自我总结",level:2}],Ae.excerpt="<p>开篇讲讲这个博客这一年的「成绩」：</p>\n",Ae.permalink="/blog/2016-summary",Ae.assets={},Ae.attributes=Ae,fe.type=a,fe.internal=t,fe.contentType=n,fe.slug="letters-from-reader",fe.content=t,fe.createdAt=new Date(1569053771e3),fe.updatedAt=new Date(1573555321942),fe.title="回顾了一些读者来信",fe.categories=[s],fe.layout=a,fe.date="2019-09-21 16:16:11",fe.cover="https://gbstatic.djyde.com/blog/Snapseed%208.jpg?x-oss-process=style/cover",fe.markdownHeadings=[],fe.excerpt="<p>从 2014 年开始写博客以来，因为不设评论区，我收到不少读者的 Email 来信。透过 Email, 来信的人比评论区直接评论要更严谨一些。来信中的大部分是请教问题，其它则是一些感谢的话。</p>\n",fe.permalink="/blog/letters-from-reader",fe.assets={},fe.attributes=fe,Te.type=a,Te.internal=t,Te.contentType=n,Te.slug="dentist-exp",Te.content=t,Te.createdAt=new Date(14801184e5),Te.updatedAt=new Date(1573548091943),Te.title="我看牙医的经历",Te.date="2016-11-26",Te.layout=a,Te.categories=[s],Te.tags=[p],Te.cover="https://gbstatic.djyde.com/blog/WechatIMG2.jpeg",Te.markdownHeadings=[{text:"TLDR",slug:"tldr",level:3}],Te.excerpt="<p>今年断断续续从 3 月到 11 月我都在牙诊接受牙齿修复，直到今天，修复已经完全做好了。在这个过程中我对牙科有了全新的认识，于是我希望通过分享我这一段经历，让更多人重视牙齿健康。</p>\n",Te.permalink="/blog/dentist-exp",Te.assets={},Te.attributes=Te,He.type=a,He.internal=t,He.contentType=n,He.slug="you-dont-need-to-drop-out",He.content=t,He.createdAt=new Date(14783904e5),He.updatedAt=new Date(1573548091970),He.title="你根本用不着退学",He.layout=a,He.date="2016-11-06",He.categories=[i],He.tags=[y,p],He.pin=l,He.markdownHeadings=[],He.excerpt="<p>近一年来我收到过很多邮件，说看了我的经历和文章，也想退学了。大意都是「看了你的经历，我觉得我和你一样，所以我也想退学了」，要我给他们一些意见。</p>\n",He.permalink="/blog/you-dont-need-to-drop-out",He.assets={},He.attributes=He,je.type=a,je.internal=t,je.contentType=n,je.slug="is-static-type-in-javascript-a-burden",je.content=t,je.createdAt=new Date(14751072e5),je.updatedAt=new Date(1573548091950),je.title="静态类型在 JavaScript 中是一种负担吗？",je.layout=a,je.date="2016-09-29",je.categories=[r],je.tags=["typescript",Ce,w],je.pin=l,je.markdownHeadings=[{text:Se,slug:Se,level:3},{text:"静态类型的 JavaScript",slug:"静态类型的-javascript",level:3}],je.excerpt='<p>最近我在公司的项目中遇到很多由于类型不匹配所导致的不可预估的问题。比如说，我们的程序产生了一个纯数字的 unique id, 存到数据库中被识别为 <code v-pre="">number</code> 类型，但是客户端需要的是字符串，导致一条数据在没有办法在客户端正常显示。</p>\n',je.permalink="/blog/is-static-type-in-javascript-a-burden",je.assets={},je.attributes=je,Re.type=a,Re.internal=t,Re.contentType=n,Re.slug="my-liqi",Re.content=t,Re.createdAt=new Date(14733792e5),Re.updatedAt=new Date(1573548091955),Re.title="我的利器",Re.date="2016-09-09",Re.layout=a,Re.categories=[s],Re.tags=[Pe],Re.markdownHeadings=[{text:qe,slug:qe,level:3},{text:Ee,slug:Ee,level:3},{text:"软件呢？",slug:"软件呢？",level:3},{text:Ie,slug:Ie,level:3},{text:ze,slug:ze,level:3},{text:Ue,slug:Ue,level:3}],Re.excerpt="<p>我是 Randy，一名 95 后程序员，在一家创业公司做前端工程师。热衷于技术和各种科技、数码产品。</p>\n",Re.permalink="/blog/my-liqi",Re.assets={},Re.attributes=Re,Ge.type=a,Ge.internal=t,Ge.contentType=n,Ge.slug="one-year-after-dropping-out-of-school",Ge.content=t,Ge.createdAt=new Date(14732928e5),Ge.updatedAt=new Date(1573548091960),Ge.title="离开大学这一年",Ge.layout=a,Ge.categories=[i],Ge.date="2016-09-08",Ge.tags=["life",p,y],Ge.pin=l,Ge.markdownHeadings=[{text:"写在最后",slug:"写在最后",level:2}],Ge.excerpt="<p>写这篇文章是想说说退学一年后的一些想法。想看技术总结请移步。如果不想看这么多的文字，可以直接拉到最下面，看<strong>写在最后</strong>的内容。</p>\n",Ge.permalink="/blog/one-year-after-dropping-out-of-school",Ge.assets={},Ge.attributes=Ge,Je.type=a,Je.internal=t,Je.contentType=n,Je.slug="tools-of-my-macbook",Je.content=t,Je.createdAt=new Date(14704416e5),Je.updatedAt=new Date(1573548091967),Je.title="我常用的 macOS 应用",Je.layout=a,Je.date="2016-08-06",Je.categories=[s],Je.tags=[Pe],Je.markdownHeadings=[{text:"Google Chrome",slug:"google-chrome",level:3},{text:"ShadowsocksX",slug:"shadowsocksx",level:3},{text:"Moom (付费)",slug:"moom-付费",level:3},{text:"iTerm",slug:"iterm",level:3},{text:"Visual Studio Code",slug:"visual-studio-code",level:3},{text:"Sublime Text 3",slug:"sublime-text-3",level:3},{text:"iStat Menus (付费)",slug:"istat-menus-付费",level:3},{text:"1Password (付费)",slug:"1password-付费",level:3},{text:We,slug:We,level:3},{text:Me,slug:Me,level:3},{text:Ne,slug:Ne,level:3},{text:"z",slug:"z",level:3}],Je.excerpt="<p>在使用 11' Macbook Air 整整两年后的今天换上了 13' Macbook Pro. 我从零开始重新搭配了我的开发环境和日常使用频率很高的工具，在这里跟大家分享一下。也借这个机会给刚开始接触 macOS 的朋友一个参考。</p>\n",Je.permalink="/blog/tools-of-my-macbook",Je.assets={},Je.attributes=Je,Le.type=a,Le.internal=t,Le.contentType=n,Le.slug="lan-ni-li-jun-yi",Le.content=t,Le.createdAt=new Date(14660064e5),Le.updatedAt=new Date(1573548091951),Le.title="《烂泥》李峻一",Le.date="2016-6-16",Le.layout=a,Le.tags=[v],Le.markdownHeadings=[],Le.excerpt="<p>你可能未听过李峻一，但你应该听过许志安《烂泥》，郑中基的《无赖》，关心妍的《放生》，陈奕迅的《Lonely Christmas》。这几首音乐都由他作曲填词。</p>\n",Le.permalink="/blog/lan-ni-li-jun-yi",Le.assets={},Le.attributes=Le,Ve.type=a,Ve.internal=t,Ve.contentType=n,Ve.slug="from-blog-migration-to-fun-of-creation",Ve.content=t,Ve.createdAt=new Date(14656608e5),Ve.updatedAt=new Date(1573548091944),Ve.title="从博客搬迁到创造的乐趣",Ve.date="2016-6-12",Ve.categories=[i],Ve.layout=a,Ve.tags=o,Ve.markdownHeadings=[],Ve.excerpt='<p>几天前因为一些很蠢的原因，我的域名被微信加入了黑名单，分享我的博客链接到朋友圈只有我自己能看见。还好我在大概两周前开始考虑博客搬迁的事情。我在万网买了 <a href="http://lutaonan.com">lutaonan.com</a> 的域名，以后只要访问这个域名就能直接访问我的博客，RSS 地址为 <a href="http://lutaonan.com/rss">http://lutaonan.com/rss</a> 。<a href="http://djyde.github.io">http://djyde.github.io</a> 将不再更新，一个月后会强制定向到 <a href="http://lutaonan.com">lutaonan.com</a>。 服务器迁移到了阿里云青岛的机房。博客引擎从 Hexo 换成 Ghost. 更换引擎的目的单纯，仅仅是想试试 Ghost 而已，并非觉得哪个比哪个好。</p>\n',Ve.permalink="/blog/from-blog-migration-to-fun-of-creation",Ve.assets={},Ve.attributes=Ve,Oe.type=a,Oe.internal=t,Oe.contentType=n,Oe.slug="533-travel-middle-school",Oe.content=t,Oe.createdAt=new Date(14654304e5),Oe.updatedAt=new Date(1573548091940),Oe.title="中山纪念中学游记",Oe.date="2016-06-09",Oe.layout=a,Oe.tags=["travel"],Oe.markdownHeadings=[],Oe.excerpt="<p>考虑到移动设备用户，文中图片都经过七牛 50% 质量压缩。非广角照片拍摄设备均为 iPhone SE.</p>\n",Oe.permalink="/blog/533-travel-middle-school",Oe.assets={},Oe.attributes=Oe,Qe.type=a,Qe.internal=t,Qe.contentType=n,Qe.slug="say-in-21",Qe.content=t,Qe.createdAt=new Date(1458864e6),Qe.updatedAt=new Date(1573548091962),Qe.title="21 岁我想说的",Qe.date="2016-03-25",Qe.layout=a,Qe.categories=[s],Qe.tags=[m],Qe.markdownHeadings=[],Qe.excerpt="<p>在我很小的时候，在香港电视剧的影响下，我最初的理想是当一名警察。但是很不幸，当我向着全班描述这个理想的时候，班上的同学都哈哈大笑，甚至老师也对我说，你这样的身材，能打得过小偷么。</p>\n",Qe.permalink="/blog/say-in-21",Qe.assets={},Qe.attributes=Qe,Be.type=a,Be.internal=t,Be.contentType=n,Be.slug="how-do-i-track-app-price",Be.content=t,Be.createdAt=new Date(14580864e5),Be.updatedAt=new Date(1573548091949),Be.title="我是如何监听 APP 价格变动的",Be.layout=a,Be.date="2016-03-16",Be.categories=[r],Be.tags=[he],Be.markdownHeadings=[{text:"动机",slug:"动机",level:2},{text:"思路",slug:"思路",level:2},{text:"Catchem",slug:"catchem",level:2},{text:"获取 APP 信息",slug:"获取-app-信息",level:3},{text:"监听任务",slug:"监听任务",level:3},{text:"Integrations",slug:"integrations",level:3},{text:"表现",slug:"表现",level:2},{text:"发送微信消息的 hook",slug:"发送微信消息的-hook",level:3},{text:"开源",slug:"开源",level:2}],Be.excerpt="<p>自从入手了 iPad mini 之后，我剁手入了很多游戏。有些游戏太贵，希望等降价或者限免才入。于是我开始找一些提供降价限免资讯的网站。</p>\n",Be.permalink="/blog/how-do-i-track-app-price",Be.assets={},Be.attributes=Be,Ye.type=a,Ye.internal=t,Ye.contentType=n,Ye.slug="my-wubi-exp",Ye.content=t,Ye.createdAt=new Date(14579136e5),Ye.updatedAt=new Date(1573548091956),Ye.title="我学五笔的经历",Ye.layout=a,Ye.categories=[s],Ye.date="2016-03-14",Ye.tags=["life",p],Ye.markdownHeadings=[{text:"五笔的规律",slug:"五笔的规律",level:2},{text:_e,slug:_e,level:2},{text:Fe,slug:Fe,level:2},{text:Xe,slug:Xe,level:2}],Ye.excerpt='<p>最近总是看到社区有人讨论输入法，有朋友安利双拼，有人想 <a href="https://v2ex.com/t/256251">开始学五笔</a>，看了一些回帖，作为一个打了 6,7 年五笔的年轻人，我很有感触，所以就写写我学五笔的经历，给大家借鉴借鉴。</p>\n',Ye.permalink="/blog/my-wubi-exp",Ye.assets={},Ye.attributes=Ye,$e.type=a,$e.internal=t,$e.contentType=n,$e.slug="vue-and-webpack",$e.content=t,$e.createdAt=new Date(14408064e5),$e.updatedAt=new Date(1573548091969),$e.title="Vue.js 和 Webpack",$e.layout=a,$e.date="2015-08-29",$e.categories=[r],$e.tags=[Ce,w,"vue"],$e.pin=l,$e.markdownHeadings=[{text:"About Vue.js",slug:"about-vue-js",level:2},{text:"Why Vue.js",slug:"why-vue-js",level:2},{text:"Using Vue.js",slug:"using-vue-js",level:2},{text:"组件化",slug:"组件化",level:3},{text:"路由",slug:"路由",level:3},{text:"About Webpack",slug:"about-webpack",level:2},{text:"Using Webpack",slug:"using-webpack",level:2},{text:"多入口文件",slug:"多入口文件",level:3},{text:"loader",slug:"loader",level:3},{text:"Why Vue.js + Webpack",slug:"why-vue-js--webpack",level:2},{text:"Using Vue.js + Webpack",slug:"using-vue-js--webpack",level:2},{text:"css 分离",slug:"css-分离",level:3},{text:u,slug:u,level:2},{text:x,slug:x,level:2}],$e.excerpt="<p><strong>转载前请务必先联系邮箱</strong></p>\n",$e.permalink="/blog/vue-and-webpack",$e.assets={},$e.attributes=$e,Ke.type=a,Ke.internal=t,Ke.contentType=n,Ke.slug="note-to-new-programming-students",Ke.content=t,Ke.createdAt=new Date(14357088e5),Ke.updatedAt=new Date(1573548091959),Ke.title="写给即将学习编程的大学新生",Ke.layout=a,Ke.date="2015-07-01",Ke.categories=[i],Ke.tags=[y],Ke.pin=l,Ke.markdownHeadings=[{text:"一些困惑",slug:"一些困惑",level:3},{text:"So, How?",slug:"so-how",level:3},{text:"一些现状",slug:"一些现状",level:3},{text:"为未来铺路",slug:"为未来铺路",level:3},{text:"最后",slug:"最后",level:3}],Ke.excerpt="<p>写下这篇文章，是由于我想和即将进入大学有意学习编程的同学谈谈关于编程的事，因为你可能需要一些建议，来步入这个新的阶段。</p>\n",Ke.permalink="/blog/note-to-new-programming-students",Ke.assets={},Ke.attributes=Ke,Ze.type=a,Ze.internal=t,Ze.contentType=n,Ze.slug="2014-summary",Ze.content=t,Ze.createdAt=new Date(1419984e6),Ze.updatedAt=new Date(1573548091934),Ze.title="2014 年终总结",Ze.layout=a,Ze.date="2014-12-31",Ze.categories=[s],Ze.tags=m,Ze.markdownHeadings=[],Ze.excerpt="<p>2014 年因为有高考所以比往年过得快了些，大学的一个学期转眼也过了。有时候甚至缓不过神来，甚至让我常常有种错觉，2014 它早就过了，但 2015 它迟迟未来。</p>\n",Ze.permalink="/blog/2014-summary",Ze.assets={},Ze.attributes=Ze,D),tt=e.options.beforeCreate||[];e.options.beforeCreate=[function(){this.$page=et}].concat(tt);["layout","transition"].forEach((function(t){var a=e.options.PageComponent;a&&(e.options[t]=a[t]),void 0===e.options[t]&&(e.options[t]=et[t])})),et.slug&&(e.options.name="page-wrapper-"+et.slug.replace(/[^0-9a-z\-]/i,"-"))},s=Object(n.a)({},(function(){var e=this.$createElement;return(this._self._c||e)("layout-manager")}),[],!1,null,null,null);"function"==typeof l&&l(s);t.default=s.exports}}]);